def standardize_zip (zip):
    if len(zip) < 5:
        #prepend 0's to shorter zipcodes
        newzip = zip.zfill(5)
    else:
        newzip = str(zip)
        #cut longer zipcodes to 5-digits
        newzip = zip[:5]
    return newzip

